import React from 'react'

const Project = (props) => {

  return (
      <div className="project">
        <h3> {props.project.title} </h3>
        <img src='{project.img}' />
        <ul>
          <li> {props.project.description} </li>
          <li> <img src="https://s3.us-east-2.amazonaws.com/eyg.portfolio/github+icon.jpg" href='{props.project.link} ' /></li>
        </ul>
      </div>
  );
};

export default Project;
